  createSecurityHealthAnalyticsCustomModule(
    request: CreateSecurityHealthAnalyticsCustomModuleRequest,
    context: CallContext & CallContextExt,
  ): Promise<DeepPartial<SecurityHealthAnalyticsCustomModule>>;
